import React from "react";
import "../index.css";
import { Route, NavLink, HashRouter } from 'react-router-dom'

import AboutMe from "./AboutMe"

export default class Footer extends React.Component
{
  constructor(props)
  {
    super(props);
  }
  render() {
    return (
      <div>
        <div class="container-fluid" id="fbox">
          <div class="row">
            <div class="col-sm text"><NavLink to="/aboutme">About Me</NavLink></div>
            // <div class="col-sm text"><NavLink to="/gans">GAN Project</NavLink></div>
            // <div class="col-sm text"><NavLink to="/garage">Garage</NavLink></div>
          </div>
        </div>
        <div className="content">
            <Route path="/aboutme" component={AboutMe}/>

        </div>
      </div>
    );
  }
}
